/* Generic and misc styles */
body {
    font-family: Helvetica, sans-serif;

    color: black;

    background: white;
}
table {
    table-layout: fixed;

}

}

.error, .fail {

}

}
.warn {

}
.not-run {
    color: #444444 !important;
}

#top-right-header {

}

    border-bottom-left-radius: 4px;
    background: lightgray;
}
/* Statistics table */
.statistics {
    width: 65em;

    empty-cells: show;

}

    background: #ECECF7;

}

}
.statistics td {
    vertical-align: middle;
}
.stats-col-stat {

}

    width: 5.5em;

}

    width: 9em;
}

}
.stat-name {

}

    font-size: 0.9em;

}
.tag-links span {
    margin-left: 0.2em;
}
/* Statistics graph */
.graph, .empty-graph {
    border: 1px solid black;
    width: auto;
    height: 7px;
    padding: 0;
    background: red;
}
.empty-graph {
    background: #E9E9E9;
}
.pass-bar, .fail-bar {
    float: left;
    height: 100%;
}
.pass-bar {
    background: #00F000;
}

}
.tablesorter-header:hover {

}
.tablesorter-headerAsc {

}
.sorter-false {

}
.sorter-false:hover {
    background-color: #DCDCF0;
